import React, { useEffect, useState} from 'react';
import './App.css';
import SignupForm from './components/SignupForm';
import axios from 'axios';


function App() {

  const [message,setMessage] = useState('');

  useEffect(()=>{
    axios.get('/').then((res)=>{
      setMessage(res.data);
    });
  },[]);

  return (
    <React.Fragment>
      <SignupForm/>
      {message}
    </React.Fragment>
  );
}

export default App;
